import React, { Component } from 'react';
import Header from "./Header";
import Atelier from "./Atelier"

class Accueil extends Component {

  render() {
    let imgUrl = 'https://www.google.com/url?sa=i&rct=j&q=&esrc=s&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwjBiarS-9TjAhVFxoUKHR_eAnsQjRx6BAgBEAU&url=%2Furl%3Fsa%3Di%26rct%3Dj%26q%3D%26esrc%3Ds%26source%3Dimages%26cd%3D%26ved%3D%26url%3Dhttps%253A%252F%252Fwww.qooq.com%252Frecipes%252Fgateau-tahitien-chocolat-et-coco%26psig%3DAOvVaw04Gp3c7a83cvtK3_ld7SzS%26ust%3D1564312106776137&psig=AOvVaw04Gp3c7a83cvtK3_ld7SzS&ust=1564312106776137'; 
    return (
      <div className="container-fluid">
        <Header />
        <div className="card card-image" id="header" style={{backgroundImage: 'url(' + imgUrl + ')', 
                                                          backgroundSize: 'cover', backgroundPosition: 'center center',backgroundRepeat: 'no-repeat',}}>
          <div className="text-white text-center rgba-stylish-strong py-5 px-4">
            <div className="py-5">
              <h2 id="h2accueil">ATELIER DE CUISINE</h2>
              <p className="mb-4 pb-2 px-md-5 mx-md-5"><span id="spanheader">Comment avoir une formation de bonne cuisinier ??</span> 
              <br/><br/>Des personnes entre 25 à 35 ans qui veulent apprendre à  cuisiner afin de manger correctement.
              </p>
              <a className="btn peach-gradient" href="#!" id="boutton-accueil"><i class="fas fa-clone left"></i>Voir tous les ateliers</a>
            </div>
          </div>
        </div>
        <Atelier/>
        <footer className="page-footer" id="footer">
              <center>
                <span>© 2019 Copyright   <span id="spanfooter">RAKOTONDRAZANAKA bruno</span></span>
              </center>
        </footer>
      </div>
    )
  }
}
export default Accueil;
